-- ----------------------------
-- Table structure for wechat_work_agents
-- ----------------------------
DROP TABLE IF EXISTS `wechat_work_agents`;
CREATE TABLE `wechat_work_agents`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `corp_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '企业微信ID',
  `agentid` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '企业微信应用ID',
  `secret` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '企业微信应用Secret',
  `token` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业微信应用回调事件 token验证',
  `aes_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业微信应用回调事件 数据加密aes_key',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业微信应用名称，长度不超过32个utf8字符',
  `square_logo_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业微信应用logo',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业微信应用描述，长度为4至120个utf8字符',
  `level` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '权限等级。\r\n1:通讯录基本信息只读\r\n2:通讯录全部信息只读\r\n3:通讯录全部信息读写\r\n4:单个基本信息只读\r\n5:通讯录全部信息只写',
  `privilege` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '应用对应的权限\r\nallow_party 应用可见范围（部门）\r\nallow_tag	应用可见范围（标签）\r\nallow_user 应用可见范围（成员）\r\nextra_party 额外通讯录（部门）\r\nextra_user 额外通讯录（成员）\r\nextra_tag	额外通讯录（标签）',
  `auth_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0.普通自建，1.三方应用授权，2.应用代开发',
  `auth_mode` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '授权模式，0为管理员授权；1为成员授权',
  `close` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否已删除',
  `redirect_domain` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业应用可信域名。注意：域名需通过所有权校验，否则jssdk功能将受限，此时返回错误码85005',
  `report_location_flag` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '企业应用是否打开地理位置上报 0：不上报；1：进入会话上报',
  `isreportenter` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否上报用户进入应用事件。0：不接收；1：接收',
  `home_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '应用主页url，url必须以http或者https开头（为了提高安全性，建议使用https）。',
  `customized_publish_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '代开发自建应用返回该字段，表示代开发发布状态。0：待开发（企业已授权，服务商未创建应用）；1：开发中（服务商已创建应用，未上线）；2：已上线（服务商已上线应用且不存在未上线版本）；3：存在未上线版本（服务商已上线应用但存在未上线版本）',
  `is_customized_app` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否为代开发模式',
  `permanent_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '永久授权码',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信应用' ROW_FORMAT = Dynamic;

