  `external_user_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '外部联系人id',
  `action` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '行为动作',
  `action_time` int(11) NOT NULL COMMENT '行为时间',
  `relate_user_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '相关成员id',
  `updated_at` datetime NULL DEFAULT NULL,
  `created_at` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `wework_external_contact_behaviors_corp_id_index`(`corp_id`) USING BTREE,
  INDEX `wework_external_contact_behaviors_external_user_id_index`(`external_user_id`) USING BTREE,
  INDEX `auto_shard_key_created_at`(`created_at`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 11 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信客户行为记录' ROW_FORMAT = Dynamic;

