-- ----------------------------
-- Table structure for wechat_work_contact_follow_users
-- ----------------------------
DROP TABLE IF EXISTS `wechat_work_contact_follow_users`;
CREATE TABLE `wechat_work_contact_follow_users`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `corp_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `external_userid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '外部联系人的userid',
  `unionid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '外部联系人的unionid',
  `userid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '添加了此外部联系人的企业成员userid',
  `remark` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '该成员对此外部联系人的备注',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '该成员对此外部联系人的描述',
  `oper_userid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '发起添加的userid，如果成员主动添加，为成员的userid；如果是客户主动添加，则为客户的外部联系人userid；如果是内部成员共享/管理员分配，则为对应的成员/管理员userid',
  `remark_corp_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '外部联系人所在企业的简称，仅当联系人类型是企业微信用户时有此字段',
  `remark_mobiles` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '该成员对此客户备注的企业名称',
  `add_way` smallint(6) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0	未知来源\r\n1	扫描二维码\r\n2	搜索手机号\r\n3	名片分享\r\n4	群聊\r\n5	手机通讯录\r\n6	微信联系人\r\n7	来自微信的添加好友申请\r\n8	安装第三方应用时自动添加的客服人员\r\n9	搜索邮箱\r\n10	视频号主页添加\r\n201	内部成员共享\r\n202	管理员/负责人分配',
  `state` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业自定义的state参数，用于区分客户具体是通过哪个「联系我」添加，由企业通过创建「联系我」方式指定',
  `tags` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '该成员对此客户备注的手机号码，代开发自建应用需要管理员授权才可以获取，第三方不可获取',
  `outflow` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '0 未流失 1已流失 （外部联系人删除跟进成员）',
  `inflow` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '0 未删除 1已删除 （成员删除外部联系人）',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 222 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信客户与员工关联关系' ROW_FORMAT = Dynamic;

