-- ----------------------------
-- Table structure for wechat_work_contact_ways
-- ----------------------------
DROP TABLE IF EXISTS `wechat_work_contact_ways`;
CREATE TABLE `wechat_work_contact_ways`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `corp_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `config_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '新增联系方式的配置id',
  `type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '联系方式类型，1-单人，2-多人',
  `scene` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '场景，1-在小程序中联系，2-通过二维码联系',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '联系方式的备注信息，用于助记',
  `is_temp` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否临时会话模式，默认为false，true表示使用临时会话模式',
  `skip_verify` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '外部客户添加时是否无需验证',
  `style` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '小程序中联系按钮的样式，仅在scene为1时返回，详见附录',
  `state` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '企业自定义的state参数，用于区分不同的添加渠道，在调用“获取外部联系人详情”时会返回该参数值',
  `qr_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '联系二维码的URL，仅在scene为2时返回',
  `user` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '使用该联系方式的用户userID列表，在type为1时为必填，且只能有一个',
  `party` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '使用该联系方式的部门id列表',
  `expires_in` mediumint(8) UNSIGNED NOT NULL DEFAULT 86400 COMMENT '临时会话二维码有效期，以秒为单位',
  `chat_expires_in` mediumint(8) UNSIGNED NOT NULL DEFAULT 86400 COMMENT '临时会话有效期，以秒为单位',
  `unionid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '可进行临时会话的客户unionid',
  `conclusions` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '结束语，可参考',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信联系我' ROW_FORMAT = Dynamic;

