-- ----------------------------
DROP TABLE IF EXISTS `wechat_work_group_chat_member_behaviors`;
CREATE TABLE `wechat_work_group_chat_member_behaviors`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `corp_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '企业id',
  `chat_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '微信群id',
  `member_user_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '群成员id，员工user_id或外部联系人user_id',
  `type` tinyint(4) NOT NULL COMMENT '成员类型。1 - 企业成员 2 - 外部联系人',
