  `created_at` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `wework_group_chat_records_corp_id_index`(`corp_id`) USING BTREE,
  INDEX `wework_group_chat_records_chat_id_index`(`chat_id`) USING BTREE,
  INDEX `idx_corpId_type_action`(`corp_id`, `type`, `action`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信客户群成员行为记录' ROW_FORMAT = Dynamic;

