-- ----------------------------
-- Table structure for wechat_work_group_chat_members
-- ----------------------------
DROP TABLE IF EXISTS `wechat_work_group_chat_members`;
CREATE TABLE `wechat_work_group_chat_members`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `corp_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `chat_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '客户群ID',
  `userid` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '群成员id',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '名字。仅当 need_name = 1 时返回\r\n如果是微信用户，则返回其在微信中设置的名字\r\n如果是企业微信联系人，则返回其设置对外展示的别名或实名',
  `group_nickname` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '在群里的昵称',
  `type` tinyint(1) UNSIGNED NOT NULL COMMENT '成员类型。\r\n1 - 企业成员\r\n2 - 外部联系人',
  `unionid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '外部联系人在微信开放平台的唯一身份标识（微信unionid），通过此字段企业可将外部联系人与公众号/小程序用户关联起来。仅当群成员类型是微信用户（包括企业成员未添加好友），且企业或第三方服务商绑定了微信开发者ID有此字段。',
  `join_time` int(11) UNSIGNED NOT NULL COMMENT '入群时间',
  `join_scene` tinyint(1) UNSIGNED NOT NULL COMMENT '入群方式。\r\n1 - 由群成员邀请入群（直接邀请入群）\r\n2 - 由群成员邀请入群（通过邀请链接入群）\r\n3 - 通过扫描群二维码入群',
  `invitor_userid` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '邀请者的userid',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 182 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信客户群成员表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of wechat_work_group_chat_members
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_work_group_chat_records
-- ----------------------------
DROP TABLE IF EXISTS `wechat_work_group_chat_records`;
CREATE TABLE `wechat_work_group_chat_records`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `corp_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '企业id',
  `chat_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '微信群id',
  `action` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '变更详情。目前有以下几种：\r\nadd_member : 成员入群\r\ndel_member : 成员退群\r\nchange_owner : 群主变更\r\nchange_name : 群名变更\r\nchange_notice : 群公告变更',
  `join_scene` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '当是成员入群时有值。表示成员的入群方式\r\n0 - 由成员邀请入群（包括直接邀请入群和通过邀请链接入群）\r\n3 - 通过扫描群二维码入群',
  `quit_scene` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '当是成员退群时有值。表示成员的退群方式\r\n0 - 自己退群\r\n1 - 群主/群管理员移出',
  `event_time` int(11) UNSIGNED NOT NULL COMMENT '企微事件时间戳',
  `member_change_count` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '当是成员入群或退群时有值。表示成员变更数量',
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `wework_group_chat_records_corp_id_index`(`corp_id`) USING BTREE,
  INDEX `wework_group_chat_records_chat_id_index`(`chat_id`) USING BTREE,
  INDEX `idx_corpId_type_action`(`corp_id`, `join_scene`, `action`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 11 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '企业微信客户群变更记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of wechat_work_group_chat_records
-- ----------------------------

